css:
kite-status kite-logo svg {
  height: 16px;
}
kite-status[status="unknown"] kite-logo svg polygon {
  fill: #9da5b4;
}
kite-status[status="authenticated"] kite-logo svg polygon,
kite-status[status="whitelisted"] kite-logo svg polygon {
  fill: #6494ed;
}
kite-status[status="reachable"] kite-logo svg polygon,
kite-status[status="authenticated"][is-active-python-file] kite-logo svg polygon,
kite-status[status="authenticated"][size-exceeds-limit] kite-logo svg polygon,
kite-status[status="whitelisted"][size-exceeds-limit] kite-logo svg polygon {
  fill: #e2c08d;
}
kite-status[status="uninstalled"] kite-logo svg polygon,
kite-status[status="unsupported"] kite-logo svg polygon,
kite-status[status="running"] kite-logo svg polygon,
kite-status[status="installed"] kite-logo svg polygon {
  fill: #ff6347;
}
